trailingComments.value:
*
 * 打开话题详情页
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise.<void>}
 *
 * @example
 * libSQ.exec('open-topic-detail-page', { params: { topicId: '20382' } }).catch((err) => {
 *   alert(`[open-topic-detail-page][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

